import React from 'react';
import './Projects.css';

const Projects = () => {
  const projects = [
    {
      title: "Project 1",
      description: "Description of project 1. Add your detailed project description here explaining the key features and technologies used.",
      tags: ["React", "Node.js", "MongoDB"],
      liveLink: "#",
      codeLink: "#"
    },
    {
      title: "Project 2",
      description: "Description of project 2. Add your detailed project description here explaining the key features and technologies used.",
      tags: ["JavaScript", "HTML", "CSS"],
      liveLink: "#",
      codeLink: "#"
    },
    {
      title: "Project 3",
      description: "Description of project 3. Add your detailed project description here explaining the key features and technologies used.",
      tags: ["Python", "Flask", "PostgreSQL"],
      liveLink: "#",
      codeLink: "#"
    },
    {
      title: "Project 4",
      description: "Description of project 4. Add your detailed project description here explaining the key features and technologies used.",
      tags: ["React", "Firebase", "Tailwind"],
      liveLink: "#",
      codeLink: "#"
    }
  ];

  return (
    <section className="projects" id="projects">
      <div className="projects-header">
        <h2>Featured Projects</h2>
        <p>Some Things I've Built</p>
      </div>
      
      <div className="projects-container">
        {projects.map((project, index) => (
          <div className="project-card" key={index}>
            <div className="project-image">
              <div className="project-overlay">
                <div className="project-links">
                  <a href={project.liveLink} className="project-btn">Live Demo</a>
                  <a href={project.codeLink} className="project-btn">View Code</a>
                </div>
              </div>
            </div>
            <div className="project-content">
              <h3>{project.title}</h3>
              <p>{project.description}</p>
              <div className="project-tags">
                {project.tags.map((tag, tagIndex) => (
                  <span key={tagIndex} className="tag">{tag}</span>
                ))}
              </div>
            </div>
          </div>
        ))}
      </div>
    </section>
  );
};

export default Projects;
